{"0": ["Очень, очень слабые застежки, понесу на ремонт. Красата на пять с плюсом а качество **", "2020-07-11T11:41:27.480235849Z", "серебристый, прозрачный", "0", 2, 0, 1, "Серьги серебряные c натуральным цирконом и фианитом", "Integra.Style"], "2": ["Серьги очень красиво смотрятся, но застежки ужасные. На вид очень хлипкие, успела одеть раза три и сломались. В результате выброшенные деньги и испорченное настроение. Зря не прислушалась к предыдущим отзывам, понадеялась что мне повезёт, но увы...", "2020-09-17T11:02:57Z", "серебристый, прозрачный", "0", 2, 0, 1, "Серьги серебряные c натуральным цирконом и фианитом", "Integra.Style"], "4": ["Отличные сирежки, очень красиво смотрятся. Все работает, нет ни каких диефектов", "2020-07-09T17:15:27.490160358Z", "серебристый, прозрачный", "0", 1, 0, 5, "Серьги серебряные c натуральным цирконом и фианитом", "Integra.Style"], "6": ["Сережки невероятно красивые, но есть один огромный минус, застежка не защелкивается :(я безумно расстроена. Т. К. Доставка была курьерская и не было возможности даже проверить их сразу. Открыв дома коробочку сначала был дикий восторг от столь великолепной красоты, а уж потом поняла, что не все столь радужно:(сейчас буду пытаться произвести возврат. Надеюсь, что деньги мне вернут, так как серьги заказывала на подарок,но до дня рождения врятли смогу их обменять:(", "2020-05-31T17:03:23.065339648Z", "серебристый, прозрачный", "0", 3, 0, 1, "Серьги серебряные c натуральным цирконом и фианитом", "Integra.Style"], "7": ["Фасад серёжек очень красивый,все просто прекрасно,но расстегнула замок,чтобы их надеть- отвалилась перемычка!!! Ювелиру назад не берут,так что завтра пойду к ювелиру припаивать ее. Настроение испорчено... Вот первый раз такое у меня,очень жаль! Теперь если не сделает ювелир,то хоть выброси!", "2020-05-26T13:24:24.905870262Z", "серебристый, прозрачный", "0", 3, 0, 1, "Серьги серебряные c натуральным цирконом и фианитом", "Integra.Style"]}
